import styled from "styled-components"

const Wrapper = styled.div`
    height:600px;
    justify-content:center;
    align-items:center;
    display:flex;
`

const EmptyTable = () => (
    <Wrapper >
        <h1>Empty</h1>
    </Wrapper>
)

export default EmptyTable
